import React, { Component } from "react";

class Movie extends Component {
  render() {
    const { title, genre, stock, rate } = this.props.movie;
    return (
      <tr>
        <th scope="row">{title}</th>
        <td>{genre}</td>
        <td>Otto</td>
        <td>@mdo</td>
      </tr>
    );
  }
}

export default Movie;
